import { useSelector } from "react-redux";
import AppLayout from "../components/AppLayout";

const Home = () => {
    const {isLoggedIn} = useSelector((state)=>state.user); //사용자가 로그인 헀는지 안했는지 여부를 알려줌
    const {mainPosts} = useSelector((state)=>state.post);

    return(
        <AppLayout> 
            <PostForm/>
            <PostCard/>
        </AppLayout>
    );
}

export default Home;
